        public static DateTime NearStation(DateTime dd, int id, ObservableCollection<Station> ls, ObservableCollection<DateTime> lsdt)
        {
            DateTime m = new DateTime(DateTime.Now.Year, DateTime.Now.Month, DateTime.Now.Day, 00, 00, 00);
            int i = 1;
            ObservableCollection<Station> ListOfStations = ls;
            int NbrOfStation = ListOfStations.Count;

            foreach (DateTime x in lsdt)
            {
                if (i == id)
                {
                    id += NbrOfStation;
                    if (x.Hour != 00)
                    {
                        if (m == new DateTime(DateTime.Now.Year, DateTime.Now.Month, DateTime.Now.Day, 00, 00, 00))
                            m = x;
                        if (x > dd)
                            return x;
                    }
                }
                i++;
            }

            return m;
        }

        public static TimeSpan RestOfTime(DateTime d)
        {
            if (d > DateTime.Now)
                return d - DateTime.Now;
            else
            {
                DateTime aux = new DateTime(DateTime.Now.Year, DateTime.Now.Month, DateTime.Now.Day, 23, 59, 59);
                TimeSpan tspain = new TimeSpan();
                tspain = aux - DateTime.Now;
                tspain = new TimeSpan(d.Hour + tspain.Hours, d.Minute + tspain.Minutes, d.Second + tspain.Seconds);
                return tspain;
            }
        }

        public static ObservableCollection<string> convertListToString(ObservableCollection<Station> ls)
        {
            ObservableCollection<string> sta = new ObservableCollection<string>();

            foreach (Station x in ls)
            {
                sta.Add(x.StationNameFR.ToLower());

            }
            return sta;
        }

        public static int SearchIdFromName(string ch, ObservableCollection<Station> ls)
        {
            int i = 1;

            foreach (Station x in ls)
            {
                if (ch == x.StationNameFR.ToLower())
                    return i;
                i++;
            }

            return i;
        }

        public static Station SearchNameFromId(int id, ObservableCollection<Station> ls)
        {
            int i = 1;
            Station st = new Station();
            foreach (Station x in ls)
            {
                if (i == id)
                    return x;
                i++;
            }

            return st;
        }

